    /**Sets <code>value</code> as attribute value for EXPIRATION_DATE using the alias name ExpirationDate
     */
    public void setExpirationDate(Date value) {
        if(value!=null && getCancellationNoticeTerm()!=null){
           Date d=value;
           Date d1=(Date)(new Date(d).addJulianDays(-(getCancellationNoticeTerm().intValue()),0));
           setRolloverDate(d1);
        }
        expirationDateFlag=true;
        setAttributeInternal(EXPIRATIONDATE, value);
    }

    /**Gets the attribute value for TERM_LENGTH using the alias name TermLength
     */
    public String getTermLength() {
        return (String) getAttributeInternal(TERMLENGTH);
    }

    /**Sets <code>value</code> as attribute value for TERM_LENGTH using the alias name TermLength
     */
    public void setTermLength(String value) {
        setAttributeInternal(TERMLENGTH, value);
        
        int term = 0;
        if (value != null) {
            if (value.equalsIgnoreCase("1 Year")) {term = 12;}
            else if (value.equalsIgnoreCase("2 Years")) {term = 24;}
            else if (value.equalsIgnoreCase("3 Years")) {term = 36;}
            else if (value.equalsIgnoreCase("4 Years")) {term = 48;}
            else if (value.equalsIgnoreCase("5 Years")) {term = 60;}
            else if (value.equalsIgnoreCase("6 Years")) {term = 72;}
            else if (value.equalsIgnoreCase("7 Years")) {term = 84;}
            else if (value.equalsIgnoreCase("8 Years")) {term = 96;}
            else if (value.equalsIgnoreCase("9 Years")) {term = 108;}
            else if (value.equalsIgnoreCase("10 Years")) {term = 120;}
            else if (value.equalsIgnoreCase("12 Years")) {term = 144;}
            else if (value.equalsIgnoreCase("15 Years")) {term = 180;}
            else if (value.equalsIgnoreCase("20 Years")) {term = 240;}       
            else if (value.equalsIgnoreCase("6 Months")) {term = 6;}
            else if (value.equalsIgnoreCase("18 Months")) {term = 18;}
            else if (value.equalsIgnoreCase("30 Months")) {term = 30;}
            else if (value.equalsIgnoreCase("42 Months")) {term = 42;}
            else if (value.equalsIgnoreCase("84 Months")) {term = 84;}
            else if (value.equalsIgnoreCase("120 Months")) {term = 120;}
            else if (value.equalsIgnoreCase("Evergreen")) {term = 1200;}
            
            
            if(getEffectiveDate()!=null){
                Date d = new Date(getEffectiveDate());
                d.addMonths(term);
                d.addJulianDays(-1,0);
                setExpirationDate(d);
            }
        }

    }

